            lp_accum__.add(normal_log<propto__>(ep_pr, 0, 1.0));
            lp_accum__.add(normal_log<propto__>(b_pr, 0, 1.0));
            lp_accum__.add(normal_log<propto__>(rho_pr, 0, 1.0));
