                Apun_pr = in__.vector_constrain(N);

            Eigen::Matrix<local_scalar_t__,Eigen::Dynamic,1>  K_pr;
            (void) K_pr;  // dummy to suppress unused var warning
            if (jacobian__)
                K_pr = in__.vector_constrain(N,lp__);
