                stan::math::initialize(ev, DUMMY_VAR__);
                stan::math::fill(ev,DUMMY_VAR__);
                validate_non_negative_index("PEfreq_fic", "4", 4);
                Eigen::Matrix<local_scalar_t__,Eigen::Dynamic,1>  PEfreq_fic(static_cast<Eigen::VectorXd::Index>(4));
